import copy, time
def minWindow(s: str, t: str) -> str:
  start = time.time()
  tObj = {}
  sLen = len(s)
  tLen = len(t)
  for ch in t:
    tObj[ch] = tObj.get(ch,0) + 1
  minSub = ""
  l = 0
  while l < sLen:
    if s[l] not in tObj:
      l+=1
      continue
    currentT = copy.deepcopy(tObj)
    r = l
    curTLen = tLen
    while r < sLen:
      if s[r] in currentT and currentT[s[r]] > 0:
        curTLen-=1
        currentT[s[r]] = currentT[s[r]] - 1
        if curTLen == 0:
          # print('break')
          break
      r+=1
    if curTLen == 0:
      if len(minSub) == 0:
        minSub = s[l:r+1]
      elif r - l + 1 < len(minSub):
        minSub = s[l:r+1]
    l+=1
  end = time.time()
  print(end - start)
  return minSub

def minWindowFast(s: str, t: str) -> str:
      if t == "":
          return ""

      countT, window = {}, {}
      for c in t:
          countT[c] = 1 + countT.get(c, 0)

      have, need = 0, len(countT)
      res, resLen = [-1, -1], float("infinity")
      l = 0
      for r in range(len(s)):
          c = s[r]
          window[c] = 1 + window.get(c, 0)

          if c in countT and window[c] == countT[c]:
              have += 1

          while have == need:
              # update our result
              if (r - l + 1) < resLen:
                  res = [l, r]
                  resLen = r - l + 1
              # pop from the left of our window
              window[s[l]] -= 1
              if s[l] in countT and window[s[l]] < countT[s[l]]:
                  have -= 1
              l += 1
      l, r = res
      return s[l : r + 1] if resLen != float("infinity") else ""

